import React, { Component } from "react";
import Sidebar from "./components/Sidebar/Sidebar";
import Header from "./components/Header/Header";
import Feed from "./components/Feed/Feed";
import Widgets from "./components/Widgets/Widgets";
import Register from "./components/Register/Register";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./components/Home/Home";
import "./App.css";
import { withCookies } from "react-cookie";
import { BrowserRouter, Switch, Route, Redirect, Link } from "react-router-dom";
import Login from "./components/Login/Login";
import Profile from "./components/Profile/Profile";
import ActivityLeft from "./components/Profile/ActivityLeft";
import ActivityMain from "./components/Profile/ActivityMain";
import ActivityRight from "./components/Profile/ActivityRight";
import GenerateData from "./components/GenerateData";

class App extends Component {

  render() {
    return (
      <BrowserRouter>
        <div>
          <Switch>
            {" "}
            <Route>
              <div className="app">
                {/*  To generate multiple post at a time (Devlopement purpose) */}
                {/* <GenerateData /> */}
                {/* <div className="app__body"> */}
                <Route exact path="/home" component={() => <Home />} />
                <Route
                  exact
                  path="/login"
                  render={(props) => <Login {...props} />}
                />
                <Route exact path="/join_now" component={() => <Register />} />
                <Route
                  exact
                  path="/"
                  component={() =>
                    this.props.cookies.get("auth-token") ? (
                      <div className="app__body">
                        {" "}
                        <Header />
                        <Sidebar />
                        <Feed />
                        <Widgets />
                      </div>
                    ) : (
                      <React.Fragment>
                        <Home />
                      </React.Fragment>
                    )
                  }
                ></Route>
                <Route
                  exact
                  path="/profile"
                  component={() => (
                    <div className="app__body">
                      <Header />
                      <Profile />
                    </div>
                  )}
                />
                <Route
                  exact
                  path="/activity"
                  component={() => (
                    <div className="app__body">
                      <Header />
                      <ActivityLeft />
                      <ActivityMain />
                      <ActivityRight />
                    </div>
                  )}
                ></Route>
                {/* </div> */}
              </div>
            </Route>
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default withCookies(App);
